import React from 'react';
import "../css/Navbar.css";

function Navbar() {
    return <div className="navbar">
    <div className="header">Online Programmers Forum
        <div className="header-logout">Logout
            <div className="header-button">Add Question
            </div>
        </div>
    </div>
</div>
    
}

export default Navbar;
